        //         {store.data.map(c => <MenuItem key={c.id} value={c.type}>{c.type}</MenuItem>)}
        //     </Select>
        // </div>
        <div>
            <InputLabel htmlFor={field.id}>Category</InputLabel>
            <NativeSelect id={field.id}>
                {store.data.map(c => <option value={c.type}>{c.type}</option>)}
            </NativeSelect>
        </div>
    )
});
